import React, { useEffect } from 'react';
import EditIcon from '@material-ui/icons/Edit';

const EditButton = ({ setShowForm, showForm }) => {
  return (
    <button onClick={() => setShowForm(true)}>
      <EditIcon />
    </button>
  );
};

export default EditButton;
